// decorators.js

export function RowSelect(target, key) {
    target._rowSelectMethod = key;
}

export function Create(target, key, descriptor) {
    target._createMethod = key;
}

export function BeforeInsert(target, key, descriptor) {
    target._beforeInsertMethod = key;
}

export function AfterInsert(target, key, descriptor) {
    target._afterInsertMethod = key;
}

export function InitDependencies(target, key, descriptor) {
    target._initDependenciesMethod = key;
}
